    return (
        <div className="balance">
            <h2>Balance</h2>
            <h4>$0.00</h4>
            <div className="income-expence">
                <div className="plus">
                    <h3>Income</h3>
                    <h3>+$0.00</h3>
                </div>
                <div className="minus">
                    <h3>Expense</h3>
                    <h3>-$0.00</h3>
                </div>
            </div>
        </div>
    )
}
export default Balance;
